memtotal=fetch('node.memory.total.bytes')$global_tag_filter.downsample('[[__interval]]', 'avg').sum();
memfree=fetch('node.memory.bytes')$global_tag_filter.tag_filter('state==free').downsample('[[__interval]]', 'avg').sum();
membuffers=fetch('node.memory.bytes')$global_tag_filter.tag_filter('state==buffers').downsample('[[__interval]]', 'avg').sum();
memcached=fetch('node.memory.bytes')$global_tag_filter.tag_filter('state==cached').downsample('[[__interval]]', 'avg').sum();
memunused=memfree.add(membuffers, ignore='state').add(memcached, ignore='state');
hundred=100;
mem_available_percent=memunused.div(memtotal).mult(hundred);
mem_used_percent=hundred.sub(mem_available_percent);
output(mem_used_percent, mem_available_percent);

